import React from 'react';

const Navbar = () => {
  return (
    <nav>
     <div><span style="color: '#DBFF00', fontSize: 20, fontFamily: 'Poppins', fontWeight: '900', wordWrap: 'break-word'">BLOCK</span><span style="color: '#DBFF00', fontSize: 20, fontFamily: 'Poppins', fontWeight: '400', wordWrap: 'break-word'">OPUS</span></div>
    </nav>
  );
};

export default Navbar;
